・シンプルな無地のメンズ折畳み傘。<br>・手元には柔軟性と弾力性を持つハーフカラーのEVA素材を採用。<br>・サイズは60cmと大判サイズなので折りたたみなのにゆったり使えます。<br>・親骨にグラスファイバーを採用。<br>・軽量かつ、強風や突風で壊れにくいタフなアイテムです。<br>・生地には超撥水のデュポン社製テフロン加工を施しています。<br><br>【ミクニとは……】<br>1951年創業のmikuni(株式会社三国）は、オリジナリティ溢れるアイテムを、可能な限り上質に、可能な限り低価格に、をモットーに、常に新しいデザインを目指し前進を続けています。<br>手ごろな価格で、人とはちょっとだけ違った個性を、レイングッズで提案しつづけます。<br><br><br>【商品スペック】<br>[使用時サイズ(全長×直径)]: 約60cm×約105cm<br>[収納時サイズ(全長×直径)]: 約31cm×約5.5cm<br>[重量]: 約220g<br>[親骨の長さ]: 60cm<br>[親骨の本数]: 6本<br><br>[企画国]: 日本<br>[生産国]: 中国<br>[素材]: 布地/ポリエステル(デュポン社製テフロン加工), 親骨/グラスファイバー, シャフト/スチール, ハンドル/EVA(エチレンビニルアセテート)<br>[詳細]: <br>　耐風仕様<br><br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

