・クニルプスの技術・デザイン・品質を象徴するニューアイコン、ティー・シリーズ。Small Manual。<br>いつでも手元に。<br>・高品質素材の組み合わせで最適化された重量。<br>・風によるねじれの耐久性が向上した12 角のシャフト。<br>・小さく、コンパクトで使いやすい。<br>・手動開閉。<br>・たたむと小さく、広げると十分な大きさ。<br>・収納袋付属。<br><br>【クニルプスとは……】<br>『クニルプス』 ドイツで生まれた 折りたたみ傘の代名詞<br>質実剛健なドイツ人が認めた確かな品質とモダンなデザインが融合した折りたたみ傘ブランドKnirps(クニルプス)。<br>ドイツ語では"Knirps"という単語は「折りたたみ傘」の代名詞となっているほど、Knirpsは非常に高い認知度を誇っています。<br>最新の技術と、ファッションアイテムとしてふさわしいデザインは、こだわりのあるヨーロッパの人々に愛されています。<br><br><br>【商品スペック】<br>[使用時サイズ(直径×全長)]: 約94cm×約54cm<br>[収納時サイズ(直径×全長)]: 約6cm×約18cm<br>[重量]: 約255g<br>[親骨の長さ]: 52cm<br>[親骨の本数]: 8本<br><br>[企画国]: ドイツ<br>[生産国]: 中国<br>[素材]: 布地/ポリエステル(撥水加工), 親骨/アルミ、グラスファイバー、スチール, シャフト/アルミ, ハンドル/ABS樹脂<br><br>【販売上の注意】<br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
